import "./App.css";
import Navbar from "./components/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";


import Chess from "./Maincontent/Chess/Chess";
import FootBall from "./Maincontent/FootBall/FootBall";
import VolleyBall from "./Maincontent/VolleyBall/VolleyBall";
import TableTennis from "./Maincontent/TableTennis/TableTennis";
import Rugby from "./Maincontent/Rugby/Rugby";
import { Login } from "./Login/Login";
import Home from "./Maincontent/Home/Home";






function App() {
    return (
        <>



<Router>
        <Switch>
                    <Route path="/home" exact component={<Home />} />
                    <Route path="/Chess"  exact component={<Chess />} />
                    <Route path="/FootBall" exact component={<FootBall />} />
                    <Route path="/TableTennis" exact component={<TableTennis />} />

                    <Route path="/Volleyball" exact component={<VolleyBall />} />
                    <Route path="/Rugby" exact component={<Rugby />} />
                    <Route path="/login" exact component={<Login />} />
        </Switch>
      </Router>
      <Navbar/>





        </>
    );
}

export default App;
